==简介==
Gupschooltheme模板提供《[[少女与战车]]》中战车道联盟加盟高中（20所，其中16所参加了第63届战车道大赛）及大学选拔队的学校主题信息。根据战车道联盟的规则，战车道大赛使用的战车为1945年8月15日以前设计完成的战车。（大学选拔队例外。）<ref>[https://matome.naver.jp/odai/2143190556486255601/2143190696087221603 {{lj|作品内の世界で行なわれている、戦車を用いて行なわれる武道。伝統的な文化であり世界... : ガールズ＆パンツァー【まとめ】 - NAVER まとめ}}]</ref>所以所有高中的主题信息使用的国旗皆为二战结束以前的国旗。（比如桑德斯大学附属高中使用的就是1912年-1959年版的48星的美国国旗[[File:Flag of the United States (1912-1959).svg|25px|link=|alt=]]。）
